  \"2015-01-22T15:57:56.474114\",\n\t\"name\": \"nsp-production-reports\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NSP Production Reports contain cumulative
  data on units assisted with NSP funds. An NSP grantee reports on the accomplishment
  of an activity when it meets an End Use, such as providing down payment assistance
  to an eligible household, demolition of a blighted property, or acquiring and rehabbing
  a foreclosed property and selling it to an eligible owner occupant.nThese reports
  include three Summary Reports of aggregated data for all NSP1, NPS2 and NSP3 grantees,
  as well as individual state reports for the NSP1 and NSP3 programs. The NSP2 Summary
  Report does not include State and Local Government data, as NSP2 funding was awarded
  through a competitive process that includes non-profit organizations. It should
  also be noted that where the data indicate State vs. Local Government, State refers
  to the state grantees while Local Government refers to the municipal and urban county
  grantees.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
